import React from 'react';
import PropTypes from 'prop-types';

export const Checkout = ({itemCount, itemPrice, onClickCheckout}) => (
      <div className="container mr-2">
        <div className="row justify-content-end">
         <span className="text-md-center">
          {itemCount > 0?
            <span className="text-md-center">Items: {itemCount} Price: ${itemPrice}</span>
            :
            <span/> 
          }
          {itemCount > 0?
          <button type="button" className="btn btn-primary ml-2" onClick={onClickCheckout} >Checkout</button>
          :
          <button type="button" className="btn btn-muted ml-2" >Checkout</button>
          }
          </span>
        </div>
      </div>
);

Checkout.propTypes = {
  itemCount: PropTypes.string.isRequired,
  itemPrice: PropTypes.string.isRequired,
  onClickCheckout: PropTypes.func.isRequired
}
